Use cob_conta
go

declare @w_empresa	int,
		@w_moneda	int,
		@w_fecha	datetime

if exists (select 1 from cob_conta..sysobjects where name = 'cb_cuenta')
begin
	select @w_fecha = fp_fecha from cobis..ba_fecha_proceso
	select @w_empresa = pa_tinyint from cobis..cl_parametro where pa_nemonico = 'EMP' and pa_producto = 'ADM'
	select @w_moneda = pa_tinyint from cobis..cl_parametro where pa_nemonico = 'MLO' and pa_producto = 'ADM'
	
	delete from cob_conta..cb_cuenta where cu_empresa = @w_empresa
    

	update cob_conta..cb_cuenta
	set cu_movimiento = 'N'
	
    IF OBJECT_ID('tempdb..#cuentas_movimiento') IS NOT NULL
      DROP TABLE #cuentas_movimiento

	create table #cuentas_movimiento (cuenta cuenta not null)

	select cu_cuenta 
	from cob_conta..cb_cuenta
	where cu_cuenta not in (select distinct (cu_cuenta_padre) from cob_conta..cb_cuenta where cu_cuenta_padre is not null)
	
	update cob_conta..cb_cuenta
	set cu_movimiento = 'S'
	from #cuentas_movimiento
	where cu_cuenta = cuenta
	
	update cob_conta..cb_cuenta
    set cu_acceso = 'N'
    where cu_movimiento = 'S'
	
	update cob_conta..cb_cuenta
    set cu_acceso = 'A'
    where cu_movimiento = 'S'
	and cu_cuenta in (select re_substring from cob_conta..cb_relparam)
	
end
else
	print 'NO EXISTE TABLA cb_cuenta'
go
